import Link from 'next/link';
import NavSide from 'components/site/layout/NavSide';
import NavList from 'components/site/layout/NavList';
import NavListItem from 'components/site/layout/NavListItem';

export default function Nav({ routes = [] }) {
  return routes && routes.length !== 0 ? (
    <nav>
      <NavSide side="left">
        {
          routes.find(({ order }) => order === 0).name
          // .map((route, index) => (
          //   <div key={index}>{route.name}</div>
          // ))
        }
      </NavSide>
      <NavSide side="right">
        <NavList>
          {routes
            .filter(({ order }) => order !== 0)
            .sort((a, b) => a.order - b.order)
            .map((route, index) => {
              const { order } = route;
              if (order) return;
              return <NavListItem data={route} key={index} />;
            })}
        </NavList>
      </NavSide>

      <style jsx>{`
        nav {
          display: flex;
          position: relative;
        }
      `}</style>
    </nav>
  ) : null;
}
